import projetoData from './projetos.json'; // Renomeado para projetoData para indicar que é um array
import './cards.css';

export default function ProjetoCards() {
    return (
        <div className="projetos-container">
            {projetoData.map((projeto) => (  // Usando map para percorrer o array de projetos
                <div key={projeto.id} className="projeto-card">
                    <div className="projeto-card-classificacao">
                        <p className="subtitulo themePurple">{projeto.classification}</p>
                    </div>
                    <div className="projeto-card-titulo">
                        <p className="subtitulo themePurple">{projeto.nome}</p>
                    </div>
                    <div className="projeto-card-descricao">
                        <p className="descricao">{projeto.description}</p>
                    </div>
                </div>
            ))}
        </div>
    );
}
